import React, { useState } from "react";

const NotesList = () => {
  const [notes, setNotes] = useState([
    {
      id: 1,
      title: "First Note",
      body: "First Note Body",
      category: "Programming",
    },
    {
      id: 2,
      title: "Second Note",
      body: "Second Note Body",
      category: "Mathematic",
    },
    {
      id: 3,
      title: "Third Note",
      body: "Third Note Body",
      category: "Design",
    },
  ]);
  return (
    <div>
      <h1>List of Notes</h1>
    </div>
  );
};

export default NotesList;
